import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { ThemeProvider } from '@material-ui/styles';
import Grid from '@material-ui/core/Grid';
import theme from '../theme';
import { Typography } from '@material-ui/core';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';


const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'center',
    },
    miniButtons: {
        width: '143px',
        height: '46px',
        marginBottom: '25px',
        marginLeft: '25px',
        marginRight: '25px',
        fontSize: '24px',
        borderRadius: '8px',
    },
    text: {
        marginTop: '300px',
        marginBottom: '25px',
        textAlign: 'center',
    },
    buttonText: {
        marginTop: '300px',
        marginBottom: '25px',
        textAlign: 'center',
    },
    input: {
        alignItems: 'center',
        width: '387px',
        height: '43px',
        marginTop: '50px',
        marginBottom: '50px',
    }
}));



function CreateFridge() {
    const classes = useStyles();

    return (
        <ThemeProvider theme={theme}>
            <Grid container className={classes.root} >

                <Grid item xs={12}>
                    <Typography className={classes.text} variant="h1"> What's the name of your <br></br>community fridge?</Typography>
                </Grid>
                <TextField className={classes.input} variant="outlined" />

                <Grid className={classes.text} item xs={12}>
                <Button className={classes.miniButtons} variant="contained" color="secondary">Back</Button>
                <Button className={classes.miniButtons} variant="contained" color="primary">Next</Button>
                </Grid>
            </Grid>
        </ThemeProvider>

    );
}

export default CreateFridge;
